import React from 'react';
import './Discover.css';
import Discover from '../HomeContent/DiscoverTrailers';


function HomeDiscover (props){
    let discovered1;
    if(props.discovered1){
        movieDiscovered=props.discovered1.map(discover=>{
            return <Discover
         discover={discover} 
         key={discover.id}
         />

        })
    }
    let discovered2;
    if(props.discovered2){
        tvDiscovered=props.discovered2.map(discover=>{
            return <Discover
         discover={discover}
         key={discover.id}
         />

        })
    }

   
    return(
        <div className="content">
        <div className="title">
        <h3>Movies || Discover</h3>
        
       
        </div>
        <div className="discover">
        {discovered1}
        {discovered2}
        
        
        </div>           

        </div>
    )
}

export default HomeDiscover;
